import Comment from '../../../components/comment/Comment';

function NewsDetailPage() {
  return (
    <div className="new-detail-page">
      <Header />
      <Breadcrumbs/>
      <NewsDetail />
      <Comment />
    </div>
  );
}

export default NewsDetailPage;
